import React from 'react';
import { Pagination, Stack } from '@mui/material';

const UserPagination = ({ totalPages, currentPage, setPage }) => {
  const handleChange = (event, value) => {
    setPage(value); // Call the setPage function with the new page number
  };

  return (
    <Stack spacing={2} alignItems="center" sx={{ marginTop: 3 }}>
      <Pagination
        count={totalPages} // Total number of pages
        page={currentPage} // Current active page
        onChange={handleChange} // Handle page change
        color="primary" // Style the pagination
      />
    </Stack>
  );
};

export default UserPagination;
